  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Arrowwood Migratory
  Waterfowl Refuge outlines Refuge accomplishments from November, 1939 through January,
  1940. The report begins by summarizing the weather conditions during this period.
  Wildlife- including migratory birds, upland game birds, predators, and rodents-
  is also covered. The Refuge development and maintenance section discusses physical
  developments. Photographs are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
